import { VerticalTimeline, VerticalTimelineComponent, VerticalTimelineElement } from "react-vertical-timeline-component";

function Itinerary(props) {

    return (
        <VerticalTimeline>
            <VerticalTimelineElement
                date = "1:45pm">
                <h3>Restaurant</h3>
                <p>This is really good</p>
            </VerticalTimelineElement>
        </VerticalTimeline>
    );
}

export default Itinerary;
